With fully secured bio-metric based authentication, the simple and intuitive app offers you peace of mind for your everyday banking activity. It is designed to offer a multitude of functions, from balance inquiry, bill payments to quick transactions. 

Using the BNF Mobile App you can: 
•	keep an eye out and take control of your finances;
•	swiftly view account balances and transactions;
•	transfer money securely between own accounts;
•	make quick payments, pay utility bills and much more;
•	send a secure message to our Customer Care team; and
•	log on a unique security device with your fingerprint or password ID.
Simple and Secure, more control for you!

High security for online shopping!
Vista 3D Secure is a mobile app dedicated to Vista Bank (Romania) cardholders, mandatory to be used in online card payments within the European Economic Area. It is compliant with SCA (Strong Customer Authentication) new legislation and certified VISA International for VISA Secure, ensuring both an integrated user experience and the highest security standards for online card payments.

It is easy to make safe online transactions using Vista 3D Secure application. 
1. Download the application;
2. Log in the application with (i) your phone number registered at the bank and (ii) the last 6 digits of your Vista Bank card number; 
3. Validate the registration in the application by entering the code received by SMS. 

ONLINE purchases can be authenticated easily, securely and quickly through Vista 3D Secure:
1.  Make an online payment to the merchant of your choice; 
2.  If the merchant site has VISA Secure standard implemented, you will receive a “push” notification;
3.  Click on the notification received and you will go directly to the Vista 3D Secure app; 
4.  You will receive on the phone screen your transaction’s details: merchant’s name and amount to be paid.
5.  After accepting the transaction, you will be requested to authorize it using your phone security code: Facial Recognition, Fingerprint, PIN or Pattern.
6.  The transaction is accepted and confirmed also by the merchant’s website.
